(1, 1, '', 0, '', 0, 0, 'APPLE', '', '2mg', 'Regular(90/10 VG/PG)', '', '', '<p><span style="color: #555555; font-family: Arial, Helvetica, sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 19.5px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; display: inline !important; float: none; background-color: #ffffff;">This is an apple lovers delight! A sweet crisp flavor of an apple and an aroma that will get your mouth to water. To best compliment&nbsp;this flavor our vapor juice has been custom crafted, aged and vortex blended.</span></p>', 'Apple-150x150.jpg', 'Apple-150x150.jpg', 'Apple-150x150.jpg', 'Apple-150x150.jpg', '', 0, '', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Active', '2014-09-01 09:19:31', '', '', 0),
(2, 1, '', 0, '', 0, 0, 'Strawberry Mango', '79.89', '2mg', 'Regular(90/10 VG/PG)', '', '', '<p>This is strawberry mango smoothie..</p>', 'products_36.jpg', 'products_36.jpg', 'products_36.jpg', 'products_36.jpg', '', 0, '', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Active', '2014-09-01 10:27:22', '', '', 0),
(3, 1, '', 0, '', 0, 0, 'SOUR KIDS WATERMELON', '98.24', '0mg', 'Regular(90/10 PG/VG)', '', '', '<p><span style="color: #555555; font-family: Arial, Helvetica, sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 19.5px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; display: inline !important; float: none; background-color: #ffffff;">Sweet and sour candy kick with a gummy candy aroma topped of with a juice watermelon burst makes for an exciting flavor.&nbsp;This flavor has been custom crafted, aged and vortex blended to provide you with the best possible vaping experience.</span></p>', 'products_38.jpg', 'products_38.jpg', 'products_38.jpg', 'products_38.jpg', '', 0, '', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Active', '2014-09-01 10:30:15', '', '', 0),
(4, 1, '', 0, '', 0, 0, 'Smokey Caramel', '100.12', '0mg', 'Regular(90/10 PG/VG)', '', '', '<p><span style="color: #555555; font-family: Arial, Helvetica, sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 19.5px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; display: inline !important; float: none; background-color: #ffffff;">Smokey Caramel is a mixture of flavors creating a pleasant aroma of caramel, sugar, and a hint of cloves. This mixture has been&nbsp;custom crafted, aged and vortex blended. For your vaping enjoyment!</span></p>', 'products_40.jpg', 'products_40.jpg', 'products_40.jpg', 'products_40.jpg', '', 0, '', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Active', '2014-09-01 10:31:43', '', '', 0),
(5, 1, '', 0, '', 0, 0, 'Hawaiian Drink', '95.36', '0mg', 'Regular(90/10 PG/VG)', '', '', '<p><span style="color: #555555; font-family: Arial, Helvetica, sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 19.5px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; display: inline !important; float: none; background-color: #ffffff;">Hawaiian drink is refreshing, sweet and mouth watering! A flavor that is a must for everyone&rsquo;s collection of E-juice.&nbsp;And to best compliment&nbsp;this flavor our vapor juice has been custom crafted, aged and vortex blended. For your vaping enjoyment!</span></p>', 'products_42.jpg', 'products_42.jpg', 'products_42.jpg', 'products_42.jpg', '', 0, '', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Active', '2014-09-01 10:33:13', '', '', 0),
(6, 1, '', 0, '', 0, 0, 'BLACK CHERRY', '78.25', '0mg', 'Regular(90/10 PG/VG)', '', '', '<p><span style="color: #555555; font-family: Arial, Helvetica, sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 19.5px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; display: inline !important; float: none; background-color: #ffffff;">Fresh black cherry taste that&rsquo;s sweet and refreshing. This is a must for every persons collection of flavors.&nbsp;To best compliment&nbsp;this flavor our vapor juice has been custom crafted, aged and vortex mixed blended.</span></p>', 'black-Cherry-300x300.jpg', 'black-Cherry-300x300.jpg', 'black-Cherry-300x300.jpg', 'black-Cherry-300x300.jpg', '', 0, '', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Active', '2014-09-01 11:51:23', '', '', 0),
(7, 1, '', 0, '', 0, 0, 'SOUR BLUEBERRY', '85.6', '0mg', 'Regular(90/10 PG/VG)', '', '', '<p><span style="color: #555555; font-family: Arial, Helvetica, sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 19.5px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; display: inline !important; float: none; background-color: #ffffff;">Sour blueberry gives you the wonderful flavor of blueberry with a added sour excitement&nbsp;to the taste buds. This flavor has been custom crafted, aged and vortex blended to provide you with the best possible vaping experience.</span></p>', 'sour-Blueberry-300x300.jpg', 'sour-Blueberry-300x300.jpg', 'sour-Blueberry-300x300.jpg', 'sour-Blueberry-300x300.jpg', '', 0, '', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Active', '2014-09-01 11:53:28', '', '', 0),
(8, 1, '', 0, '', 0, 0, 'COLA SYRUP', '35.56', '0mg', 'Regular(90/10 PG/VG)', '', '', '<p><span style="color: #555555; font-family: Arial, Helvetica, sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 19.5px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; display: inline !important; float: none; background-color: #ffffff;">Cola Syrup has the great crisp cola flavor that everyone loves.&nbsp;To best compliment&nbsp;this flavor our vapor juice has been custom crafted, aged and vortex blended.</span></p>', 'Cola-Syrup-300x300.jpg', 'Cola-Syrup-300x300.jpg', 'Cola-Syrup-300x300.jpg', 'Cola-Syrup-300x300.jpg', '', 0, '', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Active', '2014-09-01 11:55:15', '', '', 0),
(9, 1, '', 0, '', 0, 0, 'STRAWBERRY', '100.23', '0mg', 'Regular(90/10 PG/VG)', '', '', '<p><span style="color: #555555; font-family: Arial, Helvetica, sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 19.5px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; display: inline !important; float: none; background-color: #ffffff;">The Strawberry is one of the worlds most famous berries. Strawberry flavor is a burst of sweet and delicious strawberry flavor that the smell by itself&nbsp;will make your mouth water.&nbsp;This flavor has been custom crafted, aged and vortex blended to provide you with the best possible vaping experience.</span></p>', 'Strawberry-300x300.jpg', 'Strawberry-300x300.jpg', 'Strawberry-300x300.jpg', 'Strawberry-300x300.jpg', '', 0, '', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Active', '2014-09-01 12:01:43', '', '', 0),
