(19, 1, '', 0, 'dfsdf', 0, 0, 'SOUR QUINCE', '', '0mg', 'Regular(90/10 PG/VG)', '', '', '<p><span style="color: #555555; font-family: Arial, Helvetica, sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 19.5px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; display: inline !important; float: none; background-color: #ffffff;">Sour quince is a mixture of quince which &nbsp;has a&nbsp;unique fragrance with&nbsp;hints of pineapple, guava and Bartlett pear coupled with a sour notes for extra tang and pzazz. It is a distinctive and delicious flavor that has been&nbsp;custom crafted, aged and vortex blended.</span></p>', 'Sour-Quince-300x300.jpg', 'Sour-Quince-300x300.jpg', 'Sour-Quince-300x300.jpg', 'Sour-Quince-300x300.jpg', 'yes', 0, '', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Active', '2014-09-01 12:27:24', '', '', 0),
